import { useState, useEffect } from "react";
import "./App.css";
import styled from "styled-components";
import { FiEye } from "react-icons/fi";
import Spinner from "./Components/Spinner";

const importData = async () => import("./trajectoires.json");

const Wrapper = styled.div`
  width: 100vw;
  height: 100vh;
  background: #282c34;
`;

const Main = styled.div`
  display: flex;

  padding: 2em;
  color: snow;
`;

const Title = styled.h1`
  display: flex;
  justify-content: center;
`;

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    importData().then((file) => file && setData(file));
  }, []);

  return (
    <Wrapper>
      <Main>
        {data?.length}
        {!data?.length ? (
          <Spinner />
        ) : (
          <Title>
            <FiEye style={{ marginRight: "10px" }} />
            Lil Brother
          </Title>

          // JSON.stringify(data)
        )}
      </Main>
    </Wrapper>
  );
}

export default App;
